INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES ("ダメージ減衰", 76020005, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 602000501, 18);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES ("ＴＰ上昇上限付与", 76020005, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 602000502, 17);
